import '../css/page14.css';
import React from 'react'
import anime from "animejs";

function Page14(props){

  function animation(){
    anime.timeline().add({
      targets: '#Page14Node2',
      borderWidth: [0, 6],
      duration: 2000,
      easing: linear,
    })
  }
  if(props.display) animation();

  return(
      <div style={{display: props.display?'': 'none'}}>
        <text className="Page14NodeDes" id="Page14NodeDes1">
          <tspan> Node b<br/></tspan>
          <tspan> Term: 0</tspan>
        </text>
        <div className="Page14Node" id="Page14Node1"/>
        <text className="Page14NodeDes" id="Page14NodeDes2">
          <tspan> Node a<br/></tspan>
          <tspan> Term: 0</tspan>
        </text>
        <div className="Page14Node" id="Page14Node2"/>
        <text className="Page14NodeDes" id="Page14NodeDes3">
          <tspan> Node c<br/></tspan>
          <tspan> Term: 0</tspan>
        </text>
        <div className="Page14Node" id="Page14Node3"/>
        <div className="Page14Text" id="Page14Text1"> All the nodes start in the follower state. </div>
      </div>
  );
}

export default Page14;
